import React from 'react';
import {PriceCardDisplayV} from './src/PriceCardWidget';

const servicesData=[ {name:"Access to basic tutorials",id:1},
{name:"Basic resources",id:2},
{name:"Basic community access",id:3},
{name:"eBooks",id:4},
{name:"Podcats",id:5},
{name:"Access to souces files",id:6},
{name:"Live chat",id:7},];


const cardData=[
{
  planName:"free",
  amount:"$28 /month",
  bg:"linear-gradient(to top right, #1A329E, #95A6EE)"
},
{
  planName:"Standard",
  amount:"$35 /month",
  bg:"linear-gradient(to top right, #008F69, #ADFFE9)"
},
{
  planName:"Premium",
  amount:"$42 /month",
  bg:"linear-gradient(to top right, #E93C0C, #F9A38B)"
}
];

const priceData=[{
  planName:'free',
  services:[
    { name:"basic resources",icon:"check" },
    { name:"basic community acces",icon:"check" },
    { name:"ebooks",icon:"check" },
    { name:"podcats",icon:"check" }
 ],
  amount:"$28 /month"
},
{
  planName:'standard',
  services:[
    { name:"basic resources",icon:"check" },
    { name:"basic community acces",icon:"check" },
    { name:"ebooks",icon:"check" },
    { name:"podcats",icon:"check" }
 ],
  amount:"$28 /month"
},
{
  planName:'Premium',
  services:[
    { name:"basic resources",icon:"check" },
    { name:"basic community acces",icon:"check" },
    { name:"ebooks",icon:"check" },
    { name:"podcats",icon:"check" }
 ],
  amount:"$28 /month"
}]

const planNameStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'25px',
  paddingTop:'10px',
  textTransform:'uppercase'
  // marginTop:'5px',
}

const amountStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'35px',
  marginTop:'25px',
  marginBottom:'20px'
}

const listStyles={
  fontSize:"20px",
  color:'white',
  listStyleType:'none',
  textAlign:'left',

}

const buttonStyles={
  textAlign:'center',
  fontSize:'20px',
  marginBottom:'30px',
  borderRadius:'25px',
  backgroundColor:'white',
  paddingRight:'60px',
  paddingLeft:'60px',
  paddingTop:'5px',
  paddingBottom:'5px',
  color:'#008F69'
}


function App() {
  return (
    <div>
     <PriceCardDisplayV
     cardData={cardData}
     servicesData={servicesData}
     buttonText="Choose Plan"
     planNameStylesStyles={planNameStyles}
     amountStyles={amountStyles}
     listStyles={listStyles}
     buttonStyles={buttonStyles}
     />
    </div>
  );
}

export default App;
